import './sidebar.css';
import { RssFeed } from '@mui/icons-material';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-wrapper">
        <ul className="sidebar-list">
          <li className="sidebar-list-item"></li>
        </ul>
      </div>
    </div>
  );
};

export default Sidebar;
